INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (37039, 51, 'Ceftriaxone', 'Gallbladder Diseases', 'Ceftriaxone can precipitate in the gallbladder.  Sonographic abnormalities and symptoms of gallbladder disease have been reported.  Therapy with ceftriaxone should be administered cautiously in patients with preexisting disease of the gallbladder, biliary tract, or liver.  Serial abdominal ultrasonography may be appropriate during therapy.  The drug should be discontinued in patients who develop signs and symptoms suggestive of gallbladder disease while being treated with ceftriaxone.', '2', '', 'DDInter', 0);
